function solution(path) {
    let x = 0, y = 0;
    let visited = new Set();
    visited.add('0,0');
    let crosses = false;

    for (const ch of path) {
        if (ch === 'N') {
            y += 1;
        } else if (ch === 'S') {
            y -= 1;
        } else if (ch === 'E') {
            x += 1;
        } else if (ch === 'W') {
            x -= 1;
        } else {
            continue;
        }

        const key = `${x},${y}`;
        if (visited.has(key)) {
            crosses = true;
            break;
        }
        visited.add(key);
    }

    return crosses;  // âœ… Return the result
}
